import React from 'react';
import "./reservations.css";

const Reservations = () => {
  return (
  <div className="reservations-container">
  <form>
    <label>
      Number of guests:
        <input type="number" name="guests" />
    </label>
    <button type="Submit">Submit</button>
  </form>
  </div>
  )
}

export default Reservations;
